async function getOfflineFirstObsValue(data, value_type, concept_id) {
  const filteredData = concept_id ? data.filter((item) => item.concept_id === concept_id) : data;
  return filteredData.sort((a, b) => new Date(b.obs_datetime).getTime() - new Date(a.obs_datetime).getTime())[0]?.[value_type];
}
function getOfflineSavedUnsavedData(element) {
  const data = useDemographicsStore();
  const patientRecord = data.patient;
  return [...patientRecord[element]?.saved || [], ...patientRecord[element]?.unsaved || []];
}
function getObjectsWithLatestDate(data) {
  if (!data || data.length === 0) {
    return [];
  }
  const latestDate = data.reduce((latest, currentObj) => {
    const currentDate = new Date(currentObj.obs_datetime);
    return currentDate > latest ? currentDate : latest;
  }, new Date(data[0]?.obs_datetime));
  const latestObjects = data.filter((obj) => {
    const objDate = new Date(obj.obs_datetime);
    return objDate.getTime() === latestDate.getTime();
  });
  return latestObjects;
}
function getValueNumericForConcept(data, conceptName, type) {
  if (!(data && Array.isArray(data))) return null;
  const matchingObject = data?.find((obj) => obj?.concept_name?.toLowerCase() === conceptName?.toLowerCase());
  return matchingObject ? matchingObject[type] : null;
}

