    BPStatus,
    vitalsData,
    patient,
    // Methods
    setTodayVitals,
    setBMI,
    updateBMI,
    updateBP,
    updateRate,
    getBloodPressureStatus,
    getTemperatureStatus,
    getPulseRateStatus,
    getOxygenSaturationStatus,
